import ProfileStatusWithHooks from "./ProfileStatus/ProfileStatusWithHooks";

const ProfileData = (props) => {
    debuggerp;
    let contactsKeys =  Object.keys(props.profile.contacts);
    let contactsValues =  Object.values(props.profile.contacts);
    return (<div>
            <div>
                {props.profile.fullName}
            </div>
            <div>
                <ProfileStatusWithHooks status={props.status} postUserStatus={props.postUserStatus}
                                        disable={props.disable}/>
            </div>
            <div>
                        <span>
                        {
                            contactsKeys.map(k => {
                                return <div>{k}: <a
                                    href={contactsValues[contactsKeys.indexOf(k)]}>{contactsValues[contactsKeys.indexOf(k)]}</a>
                                </div>
                            })

                        }
                        </span>
            </div>
        </div>
    )
}

export default ProfileData
